import React from 'react';
import Container from './Container.js'
import SmallContainer from './SmallContainer.js'
import Header from './Header'
import H1 from './H1'
import P from './P'
import Button from './Button'
import Br from './Br'
import { Link } from 'react-router-dom'


class Home extends React.Component {
	render() {
		return(
			<Container>
				<Header width='100'>
					<H1 big>MY TABLETOP HERO</H1>
				<Br></Br>

					<P big>Begin your fable right. Become a Tabletop Hero.</P>
				</Header>
				<SmallContainer width='200'>
				<Button><Link to='/create'>Create Character</Link></Button>
				<br />
				<Button>Login</Button>
				</SmallContainer>

			</Container>
		);
	}

}

export default Home;
